import { Link } from "react-router-dom";
import "./ShelterProfilePage.scss";

const ShelterProfilePage = () => {
    return (
        <div id="ShelterProfilePage">
            <div className="container-fluid">
                {/* <!-- <div className="row"> */}
                <div className="row">
                    <div className="col-8">
                        <h4>
                            <Link to="/">Find Your Furever Friend</Link>
                        </h4>
                    </div>
                    <div className="col-4">
                        <h6>
                            <Link to="/ShelterViewMyAnimals">
                                View My Animals
                            </Link>
                        </h6>
                    </div>

                    {/* </div> --> */}
                    {/* <!-- end of row 1 --> */}
                </div>
                {/* end of first row */}
                <div className="row" id="Pawsitivitea">
                    <div className="col">
                        <h1>Pawsitivitea</h1>
                    </div>
                </div>
                {/* end of Pawsitiviteas row */}
                <button>
                    <Link to="/AddAPet">Add New Animal</Link>
                </button>
                {/* if I have a row with only one col needed do I need to use "-4" below */}
                <div className="row">
                    <div className="col-4">
                        <h5>Owner or point of contact: Shannon Hudson</h5>
                    </div>
                </div>
                {/* end of owner row */}
                <div className="row">
                    <div className="col-4">
                        <h5>Phone Number: (315) 586-2866</h5>
                    </div>
                </div>
                {/* end of phone number row */}
                <div className="row">
                    <div className="col-4">
                        <h5>
                            Address: PO Box 421 <br /> Tully, NY 13159
                        </h5>
                    </div>
                </div>
                {/* end of address row */}
                <div className="row">
                    <div className="col-4">
                        <h5>
                            About us: We're amazing and we fucking know it. Now
                            have a great day! :-D{" "}
                        </h5>
                    </div>
                </div>
                {/* end of about us row */}
            </div>
            {/* end of container-fluid */}
        </div>
    );
};

export default ShelterProfilePage;
